import React from "react";
import { useProfilePageStyles } from "../styles";
import ProfilePicture from "../components/shared/ProfilePicture";
import Layout from "../components/shared/Layout";
import { defaultCurrentUser } from "../data";
import { Hidden, Card } from "@material-ui/core";

function ProfilePage() {
  const classes = useProfilePageStyles();

  return (
    <Layout
      title={`${defaultCurrentUser.name} (@${defaultCurrentUser.username})`}
    >
      <div className={classes.container}>
        <Hidden xsDown>
          <Card className={classes.cardLarge}>
            <ProfilePicture />
            <Card.Content className={classes.CardContentLarge}>
              <ProfileNameSection />
              <PostCountSection />
              <NameBioSection />
            </Card.Content>
          </Card>
        </Hidden>
        <Hidden smUp>
          <Card className={classes.cardSmall}>
            <section className={classes.sectionSmall}>
              <ProfilePicture />
              <ProfileNameSection />
            </section>
            <NameBioSection />
            <PostCountSection />
          </Card>
        </Hidden>
      </div>
    </Layout>
  );
}

function ProfileNameSection() {
  return <React.Fragment>ProfileNameSection</React.Fragment>;
}

function PostCountSection() {
  return <React.Fragment>PostCountSection</React.Fragment>;
}

function NameBioSection() {
  return <React.Fragment>NameBioSection</React.Fragment>;
}

export default ProfilePage;
